import { ADD_PRODUCT } from "./actionsTypes";
const products =[

    {name:"Barra Olímpica Oficial Crossfit 20kg",price: 939.00, image:"https://img.irroba.com.br/fit-in/150x150/filters:format(webp):fill(fff):quality(95)/flexfitc/catalog/fotos-redimensionadas-centauro/1-azul-2.jpg"},
    {name:"Kit Anilha Olimpica 100kg",price: 2584.00, image:"https://img.irroba.com.br/fit-in/150x150/filters:format(webp):fill(fff):quality(95)/flexfitc/catalog/anillhas-fotos-redirecionadas/anilha-2.jpeg"},
    {name:"Kit 3 Barras Olimpicas Oficial Presilhas", price: 2552.00,image:"https://img.irroba.com.br/filters:fill(fff):quality(95)/flexfitc/catalog/fotos-redimensionadas-centauro/amarela-azul-vermelha-4.jpg"},
    {name:"Kit 5 barras Olimpica oficial",price:4086.00, image:"https://img.irroba.com.br/filters:fill(fff):quality(95)/flexfitc/catalog/fotos-redimensionadas-centauro/5-barras-azul-vermelha-e-amarela-5.jpg"},
    {name:"Barra Olimpica Oficial Crossfit 14kg Presilhas",price: 749.00,image:"https://img.irroba.com.br/filters:fill(fff):quality(95)/flexfitc/catalog/fotos-redimensionadas-centauro/1-verde-5.jpg"}

];

const productsReducer = (state = products, action) => {
    switch(action.type){
        case ADD_PRODUCT:
            const product = action.product;
            return[...state,product];
        default:
            return state;
    }
}
export default productsReducer;
